import { SpotLight } from "@react-three/drei";

const Stage = (props) => {
  return(
    <>
      <ambientLight intensity={1}/>
      <SpotLight
        distance={2}
        angle={-0.15}
        attenuation={5}
        anglePower={5}
      />
    </>
  )
}

export default Stage;
